import './toggle.css'
import moon from '../../images/moon.png'
import sun from '../../images/sun.png'

export default function Toggle() {
  return (
    <div className='t'>
        <img src={sun} alt="" className='t-icon'/>
        <img src={moon} alt="" className='t-icon'/>
    </div>
  )
}
